script: |
  super -f text -I q12473.spq | sort > q12473.out

inputs:
  - name: q12473.spq
    data: |
      SELECT DISTINCT + col0 AS col0 FROM tab1 (FORMAT parquet) WHERE NOT - ( col1 ) / + 57 + + col2 - - ( + col2 ) + col1 IN ( 25 * 47, CAST ( - 76 AS INTEGER ) + - col2, - ( - + col0 ) + - col2 * - + col1 / + + 76, + 77 / col0 * + col1 * 40 );
  - name: tab1

outputs:
  - name: q12473.out
    data: |
      51
      85
      91
